import React from 'react';
import './App.css';

function App() {
  const listChallenge = fetch('/api/challenge/names')
  return (
    <div className="App">
      <header className="head">
        Results
      </header>
      <div className="flex">
        <div>
          list : {listChallenge}
        </div>
        <div>
          info
        </div>
      </div>
    </div>
  );
}

export default App;
